import React from "react";
import { makeStyles } from "@material-ui/core/styles";
import Container from "@material-ui/core/Container";
import pton_logo from "./pton_logo.png";

const useStyles = makeStyles((theme) => ({
  root: {
    bottom: "0",
    width: "100%",
    height: "100%",
    backgroundColor: "#000000",
    borderStyle: "solid",
    borderColor: "#f58025",
    borderWidth: "4px 0px 0px 0px",
    color: "#ffffff",
    position: "relative",
    minWidth: "1200px",
  },
  logo: {
    padding: "0",
    marginLeft: "0",
    marginRight: "0",
    maxWidth: "50%",
  },
  contacts: {
    color: "#ffffff",
    textAlign: "center",
  },
}));

export default function Footer() {
  const classes = useStyles();

  return (
    <footer className={classes.root}>
      <Container className={classes.logo}>
        <img
          src={pton_logo}
          style={{ width: "20%", paddingLeft: "20px", paddingTop: "10px" }}
        ></img>
      </Container>
      <Container className={classes.contacts}>
        <strong>Contacts</strong>
        <p>
          Pace Center for Civic Engagement<br></br>
          201 Frist Campus Center Princeton, NJ 08544<br></br>
          58 Prospect Avenue, Third Floor<br></br>
          609.258.7260 | pace@princeton.edu<br></br>
        </p>
      </Container>
    </footer>
  );
}
